import React from 'react';
import styles from './Header.module.css'
import { Row, Col } from 'react-bootstrap';

const Header = () =>{
    return(
        <Row className={styles.header_row}>
        <Col xs='9' className='header'>
          <img className={styles.main_logo} src='karman2.png'></img>
          <img className={styles.header_text_logo} src='karman_text.png'></img>
        </Col>
      </Row>
    );
}
export default Header;
